import React from 'react';
import './navbar.css'

const Navbar = () => {
    return (
        <>
        <div className='navbar-container'>
            <div className='navbar-texts'>
            <a className="title" href='/about'>Tagga SKIFTE!!</a>
            <a className='test' to='/about' activeStyle>
                About
            </a>
            </div>
            <div className='test'>
                <a className='link' href='/signin'>Sign In</a>
            </div>
        </div>
        </>
    );
};

export default Navbar;
